export function functionArgs() {
    function getEmail(...args){
        console.log(args)
    }

    function setSomeDefaultString (myString = "", aList = []) {
        console.log(myString, aList)
    }

    function configurationThing({monsterSize, boatCapacity}) {
        console.log(monsterSize, boatCapacity)
    }

    getEmail("fuck", 22, false, [100, 100, 100], {sex:"male", name:"jordan"})
    setSomeDefaultString({sex:"male",name:"jordan"}, ['dog', 'monkey', 'stoner'])
    configurationThing({monsterSize:"100",monsterSize:"200",boatCapacity:300, boatCapacity:400})
}
